import './App.css';
import {BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import  CreatePlayer  from './components/players/CreatePlayer'

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path='/Create-Player' element={<CreatePlayer />} />
      </Routes>
    </div>
  );
}

export default App;
